import styled from "styled-components";

const Wrapper = styled.div`
display : flex;
`;


const Box = styled.div`
  width:200px ;
  height: 200px;
  background-color: yellow;
`;




function App() {
  return (
  
  <Wrapper>
    <Box>


    </Box>
  </Wrapper>
   );

}

export default App;
